import React, { Component } from 'react';
import './App.css';
import Customers from './components/customers';
import { Row, Col, Container, Box } from 'reactstrap';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Container fluid style={{ lineHeight: '32px' }}>
          <Row>
            <Col>
              <Box> .col </Box>
            </Col>
          </Row>

          <Row>
            <Col xs="6">
              <Box> .col-6 </Box>
            </Col>

            <Col xs="6">
              <Box> .col-6 </Box>
            </Col>
          </Row>
        </Container>
        <Customers />
      </div>
    );
  }
}

export default App;
